sources.styles\\blocks\\grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
    column-gap: 24px;
  }

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    column-gap: 24px;
  }

  &--desktop {
    display: block;

      @include onTablet {
      display: grid;
    }
  }

  &__item {
    @for $start from 1 through 6 {
      @for $end from $start through 6 {
        @include onTablet {
          &--tablet-#{$start}-#{$end} {
              grid-column: #{$start} / #{$end + 1};
            }
        }
      }
    }

    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        @include onDesktop {
          &--desktop-#{$start}-#{$end} {
              grid-column: #{$start} / #{$end + 1};
            }
          }
        }
      }
    }
  }

sources.styles\\blocks\\button.scss:
.button {
  box-sizing: border-box;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 56px;

  text-decoration: none;
  color: #fff;
  font-weight: 700;
  font-size: 16px;
  line-height: 27px;
  border-radius: 40px;
  border: 3px solid $c-text;
  background-color: $c-text;

  cursor: pointer;
  transition: all 0.3s;

  &:hover {
    background-color: transparent;
    color: $c-text;
    border: 3px solid #292929;
  }

  &:active {
    color: #fff;
    background-color: #111;
  }
}

