sources.styles\\blocks\\header.scss:
.header {
  background-image: url(/images/header.jpg);
  background-size: cover;
  background-position: 50%;

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    box-sizing: border-box;
    height: 100vh;
    padding-top: $header-top-padding;
    padding-bottom: 94px;

    @include onTablet {
      padding-bottom: 40px;
      padding-top: 52px;
    }

    @include onDesktop {
      padding-bottom: 64px;
      padding-top: 52px;
    }
  }

  &__title {
    margin: 0;

    font-style: italic;
    font-weight: 800;
    font-size: 32px;
    line-height: 100%;
    letter-spacing: -1.5px;
    color: #292929;

    @include onTablet {
      font-size: 40px;
    }

    @include onDesktop {
      font-size: 48px;
    }

    &::before {
      content: url(/images/element-vawe.svg);
      display: block;
      width: 32px;
      height: 27px;
      margin-bottom: 16px;

      @include onTablet {
        content: url(/images/sound_waves.svg);
        display: block;
        height: 76px;
        width: 63px;
        margin-bottom: 40px;
      }

      @include onDesktop {
        content: url(/images/sound_waves.svg);
        display: block;
        height: 76px;
        width: 63px;
        margin-bottom: 32px;
      }
    }

  }

  &__nav-container {
    display: flex;
    gap: 30px;
    align-items: center;
  }

  &__menu--opener {
    display: block;
    width: 18px;
    height: 12px;
    background-image: url(/images/menu.svg);
    background-size: cover;
    background-position: 50%;
    background-repeat: no-repeat;

    &:hover {
      background-image: url(/images/menu_hover.svg);
    }

    @include onTablet {
      width: 24px;
      height: 18px;
    }
  }

  &--menu {
    background-image: url(/images/menu.svg);

    &:hover {
      background-image: url(/images/menu_hover.svg);
    }
  }

  &--phone {
    background-image: url(/images/phone.svg);
  }


  &__call {

    @include onDesktop() {
        &::before {
          content: "+1 234 555-55-55";

          position: relative;
          top: 50%;
          transform: translate(-100%, -50%);

          display: block;
          width: max-content;
          padding-right: 12px;

          font-weight: 700;
          font-size: 12px;
          line-height: 16px;
          color: $c-text;
          text-align: right;
          letter-spacing: 2px;
          text-transform: uppercase;

          opacity: 0;
          pointer-events: none;

          transition: opacity 0.3s;
        }

        &:hover::before {
          opacity: 1;
          pointer-events: all;
        }
      }
    display: block;
    height: 18px;
    width: 18px;
    background-image: url(/images/phone.svg);
    background-size: cover;
    background-position: 50%;
    background-repeat: no-repeat;
    text-decoration: none;

    @include onTablet {
      width: 24px;
      height: 24px;
    }
  }

  &__top {
    @include top-actions ;
  }
}

