  &__photos {
      margin-bottom: 16px;
    }

    &__photo-container {
      position: relative;

      box-sizing: border-box;
      width: 100%;
      max-height: 320px;
      overflow: hidden;

      &::after {
        content: "";
        display: block;
        padding-bottom: 100%;
      }

      @include onTablet {
        height: 187px;
      }

