        height: 320px;
      }
    }

    &__photo {
      position: absolute;
      width: 100%;
      height: 100%;

      object-fit: cover;
      object-position: center;

      transition: scale 0.3s ease;

      &:hover {
        scale: 1.05;
      }
    }

    &__link {
      font-weight: 700;
      font-size: 16px;
      line-height: 140%;
      color: $c-text;
      text-decoration: none;
    }

    &__photo--3 {
      object-position: 90%;
    }

    &__photo--6 {
